import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import { postDog, getTemperaments } from "../actions";
import { useDispatch, useSelector } from "react-redux";

const DogCreate = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate(); //se usa para redirigir a alguna ruta //v de react reemplaza a useHistory//me redirige a la ruta que yo le diga
  const temperaments = useSelector((state) => state.temperaments);
  const [errors, setErrors] = useState({});

  const [input, setInput] = useState({
    image: "https://placedog.net/640/480?random",
    name: "",
    heightMin: "",
    heightMax: " ",
    weightMin: "",
    weightMax: "",
    weight: "",
    life_span: "",
    temperaments: [],
  });

  function handleChange(e) {
    setInput({
      ...input,
      [e.target.name]: e.target.value,
    });
    console.log(input);
  }

  function handleSelect(e) {
    setInput({
      ...input,
      temperaments: [...input.temperaments, e.target.value],
    });
  }

  function handleSubmit(e) {
    //FORM
    e.preventDefault();
    setErrors(
      validate({
        ...input,
        [e.target.name]: e.target.value,
      })
    );
    if (
      !Object.keys(errors).length &&
      input.name &&
      input.image &&
      input.heightMin &&
      input.heightMax &&
      input.weightMin &&
      input.weightMax &&
      input.lmin &&
      input.lmax &&
      input.temperament
    ) {
      input.heightMax += " cm";
      input.weightMax += " kgs";
      input.life_span = input.lmin + " - " + input.lmax + " years";
      dispatch(postDog(input));
      alert("Dog created üê∂");
      setInput({
        name: "",
        image: "",
        heightMin: "",
        heightMax: "",
        weightMin: "",
        weightMax: "",
        lmin: "",
        lmax: "",
        temperament: [],
      });
    } else {
      alert("ERROR: Dog not created üòï");
      return;
    }
    navigate("/home"); //cdo termine de crear el dog, q me redirija al home
  }

  useEffect(() => {
    dispatch(getTemperaments());
  }, [dispatch]);

  return (
    <div>
      <Link as={Link} to="/home">
        <button>HOME</button>
      </Link>
      <h1>BE CREATIVE üêæ</h1>
      <form onSubmit={(e) => handleSubmit(e)}>
        <div>
          <label>Name:</label>
          <input
            placeholder="Dog Name"
            type="text"
            value={input.name}
            name="name"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        <div>
          <label>imagen:</label>
          <input
            placeholder="Image"
            type="img"
            value={input.image}
            name="image"
            onChange={(e) => handleChange(e)}
            alt="not found"
          ></input>
        </div>
        <div>
          <label>Heigth Min:</label>
          <input
            placeholder="Min height"
            type="number"
            value={input.heigthMin}
            name="heigthMin"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        <div>
          <label>Heigth Max:</label>
          <input
            placeholder="Max height"
            type="number"
            value={input.heigthMax}
            name="heightMax"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        <div>
          <label>Weight Min:</label>
          <input
            placeholder="height Min"
            type="number"
            value={input.weigthMin}
            name="weigthMin"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        <div>
          <label>Weight Max:</label>
          <input
            placeholder="weight Max"
            type="number"
            value={input.weigthMax}
            name="weigthMax"
            onChange={(e) => handleChange(e)}
          ></input>
        </div>
        <div>
          <label>Min life years:</label>
          <input
            className="input"
            placeholder="life years"
            type="number"
            value={input.lifespan}
            name="lifemin"
            onChange={(e) => handleChange(e)}
          />
        </div>
        {/* <div>
          <label>Max life years:</label>
          <input
            className="input"
            placeholder="Max life years"
            type="number"
            value={input.lifemax}
            name="lifemax"
            onChange={(e) => handleChange(e)}
          />
        </div> */}
        <select onChange={(e) => handleSelect(e)}>
          {temperaments.map((temp) => (
            <option value={temp.name}>{temp.name}</option>
          ))}
        </select>
        <ul>
          <li>{input.temperaments.map((el) => el + " ,")}</li>
        </ul>

        <button type="submit">Crear Dogs</button>
      </form>
    </div>
  );
};

export default DogCreate;
